import React  from 'react';
// import axios from 'axios';
import { Routes, Route,Navigate } from 'react-router-dom'
import {Home} from './Home.jsx'
export const Info =(props)=>{
  
 
   return (
      
     
    <Routes>
        <Route path="/" element={<Home sum={props.summary} />} />
        <Navigate to={Home} />

      </Routes>
      
      
      
   )

}
